import React from 'react';

const DepositPage = () => {
  return (
    <div className="deposit-page">
      <h2>입금</h2>
      <div className="deposit-content">
        <p>입금 기능은 현재 준비중입니다.</p>
      </div>
    </div>
  );
};

export default DepositPage;
